<code>This is a test.</code>

In order to capture multiple lines after the first, <code>strstr</code> can be used. In that case, you need to locate the next nearest goal delimiter after which to check for thepattern. Since the goal delimiter here is <code>NUL</code>, the next closest would be <code>newline</code> (whitespace here isn't a consideration). This can be done quite easily by using <code>strpbrk</code> (note below the forward declaration of <code>sidescope</code>).
This allowed me to get the following:
<code>#include &lt;stdio.h&gt;
#include &lt;string.h&gt;

char * sidescope ( char [], char [], char );

int main()
{
    char *p = NULL, str[] = "This is a test.\nThis is another test.\n   And another test.";

    if (( p = sidescope ( str, "This is a test.", '\0' )))
        printf( "%s\n", p );
    return 0;
}

char * sidescope ( char s[], char p[], char delim )
{
    size_t    len = strlen ( p );
    char *    start = s;
    char *    found = NULL;

    if ( len )
    {
        for ( ;found = strstr ( start, p ); start = found + len )
            if ( !delim || *(found + len) == delim || !*(found + len + 1) || (delim == ' ' &amp;&amp; ((found + len + 1) - strpbrk ( found, "\n" ))))
                return (found + len);
    }
    return NULL;
}
</code>
... which gives:
<code>This is another test.
   And another test.
</code>
as output. The original solution could be modified to mimic the functionality of this answer, but by adding control over what to check for post first pattern match, this code gives the actual result that you seem to be after.
Here's a rundown of the function modification:

<code>   if ( !delim || *(found + len) == delim || !*(found + len + 1) || (delim == ' ' &amp;&amp; ((found + len + 1) - strpbrk ( found, "\n" ))))</code>

Note the Post correct return condition which is:
<code>1) Anything after found until EOL &lt;OR&gt;</code>
<code>2) Anything after found until the goal delimiter &lt;OR&gt;</code>
<code>3) Anything already parsed that has only a NUL terminator &lt;OR&gt;</code>
<code>4) A ' ' character entered as goal delimiter, where there is whitespace 
   until the remainder EOL after a pattern match</code>
Anything outside of that other than the blank lines shown above would distort the output. Sorry, no inclusion of trailing white spaces since I feel that is a completely different problem. Subbing in other goals and test input will reaffirm what is actually working a lot better than dry reading.
